import React, { Component } from 'react';
import './App.css';
import '../node_modules/font-awesome/css/font-awesome.min.css';

import WelcomeSection from './Home/WelcomeSection';
import ClubSection from './Home/ClubSection';
import InfoSection from './Home/InfoSection';
import InstagramSection from './Home/InstagramSection';
import SponsorsSection from './Home/SponsorsSection';
import FooterSection from './Home/FooterSection';

class App extends Component {
	constructor(props) {
		super(props);

		this.state = {
			instagram: []
		};
	}

	componentDidMount() {
		this.fetchInstagram();
	}

	fetchInstagram = () => {
		fetch(
			'https://api.instagram.com/v1/users/self/media/recent/?access_token=7573298529.5136810.902ba8a4eecd4a9c846e291b9ef83d57'
		)
			.then(resp => resp.json())
			.then(res => {
				let instagram = [];
				for (let i = 0; i < 8; i++) instagram.push(res.data[i].images.standard_resolution.url);

				this.setState({
					instagram
				});
			})
			.catch(err => console.log('error', err));
	};

	render() {
		const { instagram, showInstaOverlay } = this.state;
		return (
			<div className="App">
				<WelcomeSection />
				<ClubSection />
				<InfoSection />
				<InstagramSection />
				<SponsorsSection />
				<FooterSection />
			</div>
		);
	}
}

export default App;
